package com.auxiliary.designer.visitor;public abstract class Employee {    public Employee(String name, String age, String responlity) {        this.name = name;        this.age = age;        this.responlity = responlity;    }    private String name;    private String age;    private String responlity;    public String getName() {        return name;    }    public void setName(String name) {        this.name = name;    }    public String getAge() {        return age;    }    public void setAge(String age) {        this.age = age;    }    public String getResponlity() {        return responlity;    }    public void setResponlity(String responlity) {        this.responlity = responlity;    }    public abstract void accept(IVisitor visitor);}